import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route
} from 'react-router-dom';

const AppRoutes = () => (
    <Router>
        <Switch>
            <Route path="/" component={<h1>Painel</h1>} exact />
        </Switch>
    </Router>
);

export default AppRoutes;
